import React from 'react';
import bloglogo from '../../assets/Images/bloglogo.png';
import '../../assets/Styles/Styles.css';

export default class Navbar extends React.Component {
    constructor(props) {
        super(props);
        this.state = { modal: false };

        this.toggle = this.toggle.bind(this);
    }

    toggle() {
        this.setState({
            modal: !this.state.modal
        });

    }

    render() {
        return (
            <div className='navbar-wrapper'>
                <nav className="navbar navbar-expand-lg navbar-light bg-light">
                    <a className="navbar-brand" href="/"><img src={bloglogo} className='bloglogo' alt='' /></a>
                    <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse alignnav" id="navbarNavAltMarkup">
                        <div className="navbar-nav ">
                            <a className="nav-item nav-link" href="#">Tech</a>
                            <a className="nav-item nav-link" href="#">Food</a>
                            <a className="nav-item nav-link " href="#">Fitness</a>
                            <a className="nav-item nav-link " href="#">Politics</a>
                            <a className="nav-item nav-link " href="#">Beauty</a>

                        </div>


                    </div>
                    <a href='/login'>
                    <div>
                    <button type="button" className="btn btn-dark btn-lg" >
                    Create a post
                    </button>

                    </div>
                    </a>


                </nav>

            </div>
        );
    }
}
